import RAeWorkflow from "../assets/img/aw_ae_workflow.png";
import RSteamProfile from "../assets/img/aw_steam_profile.png";

export const initialState = {
    pageTitle: 'Предложи свою идею для создания композиции или зацени уже имеющиеся!',
    images: [
        {
            url: RAeWorkflow,
            title: 'Предложить идею',
            rotate: '2',
            to: '/suggest',
        },
        {
            url: RSteamProfile,
            title: 'Посмотреть композиции',
            width: '50%',
            rotate: '-5',
            to: '/compositions',
        },
    ]
}

export function homePageReducer(state = initialState, action) {
    switch (action.type) {
        case '':
            return { ...state, }

        default:
            return state
    }
}
